import React from 'react';
import { Link } from 'react-router-dom';
import FontAwesomeIcon from '@fontawesome/react-fontawesome';
import faShoppingBag from '@fontawesome/fontawesome-free-solid/faShoppingBag'

const MyButton = (props) => {

	const buttons = () => {
		let template = '';

		switch(props.type){
			case 'default':
				template = <Link 
							className= {!props.altClass ? 'link_default' : props.altClass} 
							to={props.linkTo}
							{...props.addStyle}
							> 
								{props.title}
							</Link>
				break;
			case 'bag_link':
				template = 
					<div className='bag_link'
						onClick={() => {
							props.runAction()
						}}
					> 
						{}
					</div>
			break;
			default:
				template = '';
		}

		return  template;
	}


	 return (
	    <div className='my_link'>
	      {buttons()}
	    </div>

	  )
}
export default MyButton;
